// video play
$(".vlog-format-action").click(function () {
    $("#pl").hide();
    $(".vid").hide();
    $('#yt').addClass('embed-responsive embed-responsive-16by9');
    $("#yt iframe")[0].src += "?autoplay=1";
    $("#yt iframe").show();
    });



//go-top
$(document).ready(function() {
            // Show or hide the sticky footer button
            $(window).scroll(function() {
                if ($(this).scrollTop() > 200) {
                    $('.go-top').fadeIn(200);
                } else {
                    $('.go-top').fadeOut(200);
                }
            });
            
            // Animate the scroll to top
            $('.go-top').click(function(event) {
                event.preventDefault();
                
                $('html, body').animate({scrollTop: 0}, 300);
            })
        });

//share
$(document).ready(function(){
  $(".flip").click(function(){
  $flip = $(this);
    $content = $flip.next();
    $content.slideToggle('fast');
  });
});

$(document).ready(function(){
  $(".cls").click(function(){
    var container = $('.flip');
    $conten = $(container).next();
    $conten.slideUp('fast');
  });
});



